import React from 'react';
import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
import Navigation from './components/Navigation';
import LandingPage from './components/LandingPage';
import MissionBoardPage from './components/MissionBoardPage';
import PageNotFound from './components/PageNotFound';

function App() {
    return (
        <Router>
            <Navigation />
            <Switch>
                <Route exact path="/missionboard">
                    <MissionBoardPage />
                </Route>
                <Route exact path="/">
                    <LandingPage />
                </Route>
                <Route path="/404">
                    <PageNotFound />
                </Route>
                <Redirect to="/404" />
            </Switch>
        </Router>
    );
}

export default App;
